		slCtry.countryId = function (countryName) {
		/*
			var bestMatch = 0.0;
			var bestId = -1;
		*/
			for (var i = countries.length - 1; i >= 0; i--) {
				var match = nameMatch(countryName,countries[i][0]);
				if (match === 1.0) {
					return i;
				}
		/*
				if (match > bestMatch) {
					bestMatch = match;
					bestId = i;
				}
		*/
			}
		/*
			if (bestMatch > 0.5) {
				return bestId;
			}
		*/
			return -1;
		};

		slCtry.countryAbrv = function(cId) {
			if (cId >= 0 && cId < countries.length) {
				return countries[cId][1];
			}
		};

		slCtry.stateId = function (cId,stateName) {
			var states = countries[cId][2];
/*
			var bestMatch = 0.0;
			var bestId = -1;
*/
			for (var i = 0; i < states.length; i++) {
				var match = nameMatch(stateName,states[i][0]);
				if (match === 1.0) {
					return i;
				}
/*
				if (match > bestMatch) {
					bestMatch = match;
					bestId = i;
				}
*/
			}
/*
			if (bestMatch > 0.5) {
				return bestId;
			}
*/
			return -1;
		};

		slCtry.stateAbrv = function (cId, sId) {
			if (cId === -1 || sId === -1) {
				return undefined;
			}
			var country = countries[cId];
			var states = country[2];
			var state = states[sId];
			var abbrv = state[1];
			return abbrv;
		};

		// return [stateAbreviation, countryAbreviation, newPlaceLength] || undefined
		slCtry.extractStateCountry = function (place) {
			if (place) {
				var plLen = place.length;
				var state;
				var country;
				if (plLen > 0) {
					var cId = -1;
					var sId = -1;
					if (isNaN(place[plLen - 1])) {
						// try to find country
						cId = slCtry.countryId(place[plLen - 1]);
						if (cId >= 0) {
							if (plLen > 1) {
								sId = slCtry.stateId(cId, place[plLen - 2]);
							}
						}
					} else {
						// country number already set
						cId = place[plLen - 1];
						if (plLen > 1 && !isNaN(place[plLen - 2])) {
							sId = place[plLen - 2];
						}
					}
					if (cId >= 0) {
						country = slCtry.countryAbrv(cId);
						--plLen;
						if (sId >= 0) {
							state = slCtry.stateAbrv(cId, sId);
							--plLen;
						}
						return [state, country, plLen];
					}
				}
			}
			return undefined;
		};

		return slCtry;
